import React from "react";
import Shader from "./Shader.js";
import { Dropdown, InputNumber, InputGroup } from "rsuite";
import Box from '@mui/material/Box';
import FilledInput from '@mui/material/FilledInput';
import FormControl from '@mui/material/FormControl';
import FormHelperText from '@mui/material/FormHelperText';
import Input from '@mui/material/Input';
import InputLabel from '@mui/material/InputLabel';
import OutlinedInput from '@mui/material/OutlinedInput';
import {
  Handle
} from "react-flow-renderer";
import { fs } from "./fragmentShader.js";
import { useEffect } from "react";
import { IconButton } from 'rsuite';
import ArrowDownLineIcon from '@rsuite/icons/ArrowDownLine';


const Primitives = {
	Sphere: "Sphere",
	Box:   "Box"
}

export default function PrimitiveNode({ data, id }) {
  const [primitive, setPrimitive] = React.useState(Primitives.Sphere);
  const [sdf, setSdf] = React.useState(data.sdf);
  const [showCanvas, setShowCanvas] = React.useState(true);
  const [input1, setInput1] = React.useState(1.0);
  const [input2, setInput2] = React.useState(1.0);
  const [input3, setInput3] = React.useState(1.0);

  const handleChange = (newPrimitive, newSdf) => {
    if(newPrimitive == Primitives.Sphere){
      console.log("YES");
    }
    setPrimitive(newPrimitive);
    setSdf(newSdf);
  }

  useEffect(() => {
    console.log("EFE");
    data.onChangeSdf(id, sdf);
  }, [sdf]);

  useEffect(() => {
    if(newPrimitive == Primitives.Sphere){
      setSdf(`sphere(p, ${input1})`);
    }
    else if(newPrimitive == Primitives.Box){
      setSdf(`box(p, vec3(${input1}, ${input2}, ${input3}))`)
    }
  }, [primitive]);

  return (
    <div className="custom-node">
      <div className="custom-node-header">Primitive</div>
      <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1 },
      }}
      noValidate
      autoComplete="off"
    >
      <FormControl size="small">
        <InputLabel >Nassme</InputLabel>
        <OutlinedInput
          value={input1}
          type="number"
          onChange={(ev)=>setInput1(ev.target.value)}
          label="Nassme"
        />
      </FormControl>
      <FormControl size="small" variant="filled">
        <InputLabel htmlFor="component-filled">Name</InputLabel>
        <FilledInput id="component-filled" value={"hola"} onChange={handleChange} />
      </FormControl>
    </Box>
      <Dropdown style={{width:"100%"}} title={primitive}>
        <Dropdown.Item onSelect={()=>setPrimitive(Primitives.Sphere)}>Sphere</Dropdown.Item>
        <Dropdown.Item onSelect={()=>handleChange(Primitives.Box)}>Box</Dropdown.Item>
      </Dropdown>
      {input1}
      {id}
      {data.sdf}
      <label>Read only:</label>
      <InputGroup inside size="sm" >
        <InputGroup.Addon  style={{height: "100%", background: "#E7E7E7" }}>r</InputGroup.Addon>
        <Input />
    </InputGroup>

      {/* INPUT */}
      <div className="custom-node-subheader custom-node-subheader__inputs">
        <div className="custom-node-port-in">{"Inputs"}</div>
        <div className="custom-node-port custom-node-port-in">
          label
          <Handle
            className="circle-port circle-port-left"
            type="target"
            target="0"
            id={0}
            position="left"
            onConnect={(params) => console.log('handle onConnect', params)}
          />
        </div>
      </div>

      {/* OUTPUT */}
      <div className="custom-node-subheader custom-node-subheader__output">
        <div className="custom-node-port-out">{"Outputs"}</div>
        <div className="custom-node-port custom-node-port-out">
          label
          <Handle
            className="circle-port circle-port-right"
            type="source"
            id={0}
            position="right"
          />
        </div>
      </div>

    {showCanvas ?
      <Shader
        shader={fs(sdf)}
        uniforms={{ color: { type: "3fv", value: [1.0, 1.0, 0.0] } }}
        style={{ margin: "10px" }}
      />
      :
      null
    }

      <div className="custom-node-creater">
        <IconButton onClick={()=>setShowCanvas(!showCanvas)} placement='right' icon={<ArrowDownLineIcon/>} block />
        </div>
      

      
    </div>
  );
}
